import React, {useState} from 'react'

function AddContact(){
    const [name,setName] = useState("")
    const [email,setEmail] = useState("")
    const ChangeName = (e) =>{
        console.log(name);
        setName(e.target.value);
    };
    const ChangeEmail = (e) => {
        console.log(email);
        console.log("")
        setEmail(e.target.value);
    };
    const HandleSubmit = (e) => {
        console.log(name);
        console.log(email);
        e.PreventDefault();
        console.log(e.target.value)
    };
    return (
        <form onSubmit={HandleSubmit}>
            <label> Name:
                <input type = "text" 
                name="name" 
                placeholder="Name" 
                value = {name} 
                onChange = {ChangeName}
                />
            </label>
            <label>Email :
                <input type = "email" 
                name="email" 
                placeholder="Email" 
                value = {email} 
                onChange = {ChangeEmail}
                />
            </label>
            <input type="submit" />
        </form>
    );
}

export default AddContact;
